app.get('/participantes', (req, res) => {
  res.send(participantes)
});

app.post('/participantes', (req, res) => {
  let participante = {nombre: req.body.nombre, 
                      email: req.body.email, 
                      capa: req.body.capa, 
                      alias: req.body.alias,
                      edad: req.body.edad};
  participantes.push(participante);
  
  
  res.send({'Ok': 'Objeto registrado'})
});


app.get('/participantes/:alias', (req, res) => {
  
  let alias = req.params.alias;

  for (let i = 0; i < participantes.length; i++) {
    if(participantes[i].alias === alias) {
      res.send(participantes[i]);
    }
  }
  
  res.send({'error':'No se encontro el código'});
});


app.get('/participantes/:alias/tecnologias', (req, res) => {
  
  let alias = req.params.alias;

  for (let i = 0; i < participantes.length; i++) {
    if(participantes[i].alias === alias) {
      res.send(participantes[i].tecnologias);
    }
  }
  
  res.send({'error':'No se encontro el código'});
});


app.put('/participantes/:alias', (req, res) => {
  
  let alias = req.params.alias;

  for (let i = 0; i < participantes.length; i++) {
    if(participantes[i].alias === alias) {
      let participante = participantes[i];
      //participantes.splice(i,1);
      participante.nombre = req.body.nombre;
      participante.email = req.body.email;
      participante.edad = req.body.edad;
      participante.alias = req.body.alias;
      participante.capa = req.body.capa;
      
      res.send(participante);
    }
  }
  
  res.send({'error':'No se encontro el código'});
});

app.delete('/participantes/:alias', (req, res) => {
  
  let alias = req.params.alias;

  for (let i = 0; i < participantes.length; i++) {
    if(participantes[i].alias === alias) {
      let participante = participantes[i];
      participantes.splice(i,1);
      res.send(participante);
    }
  }
  
  res.send({'error':'No se encontro el código'});
});






